DROP TABLE IF EXISTS CS130LabExam2;

create table CS130LabExam2 (
	rowID INT,
	PersonName VARCHAR(50),
	PersonAddress VARCHAR(50),
	IPAddress VARCHAR(20),
	CreditCard VARCHAR(50),
	CompanyName VARCHAR(50),
	AccessTime DATE,
	PurchaseAmount DECIMAL(6,2),
	CONSTRAINT CS130LabExam2_PKEY PRIMARY KEY (rowID)
);



